ads.description:
Dzień dobrym, mam do sprzedania samochód osobowy marki Tata Indica wyprodukowany w 2010 roku, zakupiony w polskim salonie i eksploatowany przez jednego właściciela, który został wyposażony w silnik benzynowy, doposażony w instalacje LPG (butla ważna do 2031r) o pojemności 1405 cm3, legitymujący się mocą 85 KM, który pokonał do tej pory 138000 km. Samochód pod względem mechanicznym w bardzo dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny, samochod do konca serwisowany w autoryzowanym serwisie. Wizualnie Indica prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się dobrze, jest czyste i zadbane.



Tata jest wyposażenia w:

- Klimatyzacje;

- Elektryczne szyby przednie i tylne;

- ABS;

- Centralny zamek;

- 2 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. 



Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 21.11.2025 roku.

Przegląd techniczny 30.06.2026 roku.
